import HomePage from "../Page/HomePage/HomePage";
import SubPage from "../Page/SubPage/SubPage";

export const defaultRouter = [
  { Patch: "/", Element: HomePage },
  { Patch: "/:sub", Element: SubPage },
  { Patch: "/:sub", Element: SubPage },
];
